window.bookSummaryJSON = "<p><b><i>USA TODAY </i></b><b>&amp; Amazon 3-million copy bestselling author BLAKE BANNER is at his best with his original action-packed thriller series!</b></p> <p>The call came on a Sunday morning in March, in Independence: Go to Seattle, meet a man, he will give you instructions.</p> <p>But those instructions send Lacklan on a journey he could not have suspected, protecting a senator who might be the last best hope of mankind, fleeing before the storm, hunted by killers and law enforcement alike. And when he finally reaches his destination, he discovers his ordeal has only just begun…</p> <p>But Lacklan, after ten years in the SAS, after a life of killing, has had enough. He had promised his father, on his deathbed, that he would protect Marni, the love of his life, in her fight against Omega, the ruthless government within a government. But he has grown tired, tired of chasing the impossible dream, tired of the killing.</p> <p>He is ready to break his promise. Now he dreams of home in Independence, of a normal life with a good woman. Yet that may be the most impossible dream of all, for a man who was not born to serve in Heaven, but to rule in Hell…</p>"; 
